# Variable to store Places data
$global:placesData = $null

# Function to populate tree view with Places data
function Populate-TreeView {
    $treeView.Nodes.Clear()
    
    # Get Places data using Get-PlaceV3 command
    try {
        $global:placesData = Get-PlaceV3
        $statusLabel.Text = "Connected. Retrieved $($global:placesData.Count) places."
    }
    catch {
        [System.Windows.Forms.MessageBox]::Show("Error retrieving Places data: $_", "Error", [System.Windows.Forms.MessageBoxButtons]::OK, [System.Windows.Forms.MessageBoxIcon]::Error)
        $statusLabel.Text = "Error connecting to Microsoft Places"
        return
    }
    
    # Create dictionary to quickly look up places by ID
    $placesById = @{}
    foreach ($place in $global:placesData) {
        if ($place.PlaceId) {
            $placesById[$place.PlaceId] = $place
        }
    }
	
	# Check if we need to create a separate "Rooms" node for orphaned rooms
    $orphanedRooms = $global:placesData | Where-Object { 
        $_.Type -eq "Room" -and (-not $_.ParentId -or $_.ParentId -eq "")
    }
    
	$orphanedNode = New-Object System.Windows.Forms.TreeNode
	$orphanedNode.Text = "Orphaned Items"
	$orphanedNode.ImageIndex = 5
	$orphanedNode.SelectedImageIndex = 5
	$addedOrphanedNode = $false
	
    if ($orphanedRooms.Count -gt 0) {
        $addedOrphanedNode = $true
        $treeView.Nodes.Add($orphanedNode)
        
        foreach ($room in $orphanedRooms) {
            $roomNode = New-Object System.Windows.Forms.TreeNode
            $roomNode.Text = $room.DisplayName
            $roomNode.Tag = $room
            $roomNode.ImageIndex = 4
			$roomNode.SelectedImageIndex = 4
            $orphanedNode.Nodes.Add($roomNode)
        }
    }
	
	# Check if we need to create a separate "Rooms" node for orphaned rooms
    $orphanedSpaces = $global:placesData | Where-Object { 
        $_.Type -eq "Space" -and (-not $_.ParentId -or $_.ParentId -eq "")
    }
    
    if ($orphanedSpaces.Count -gt 0) {
		if($addedOrphanedNode -eq $false)
		{
			$addedOrphanedNode = $true
			$treeView.Nodes.Add($orphanedNode)
        }
		foreach ($space in $orphanedSpaces) {
            $spaceNode = New-Object System.Windows.Forms.TreeNode
            $spaceNode.Text = $space.DisplayName
            $spaceNode.Tag = $space
            $spaceNode.ImageIndex = 3
			$spaceNode.SelectedImageIndex = 3
            $orphanedNode.Nodes.Add($spaceNode)
        }
    }
	
	# Check if we need to create a separate "Floor" node for orphaned rooms - NOTE: Not technically possible, but you never know...
    $orphanedFloors = $global:placesData | Where-Object { 
        $_.Type -eq "Floor" -and (-not $_.ParentId -or $_.ParentId -eq "")
    }
    
    if ($orphanedFloors.Count -gt 0) {
		if($addedOrphanedNode -eq $false)
		{
			$addedOrphanedNode = $true
			$treeView.Nodes.Add($orphanedNode)
		}
        foreach ($floor in $orphanedFloors) {
            $floorNode = New-Object System.Windows.Forms.TreeNode
            $floorNode.Text = $floor.DisplayName
            $floorNode.Tag = $floor
            $floorNode.ImageIndex = 2
			$floorNode.SelectedImageIndex = 2
            $orphanedNode.Nodes.Add($floorNode)
        }
    }
	
	# Check if we need to create a separate "Rooms" node for orphaned rooms - NOTE: Not technically possible, but you never know...
    $orphanedSections = $global:placesData | Where-Object { 
        $_.Type -eq "Section" -and (-not $_.ParentId -or $_.ParentId -eq "")
    }
    
    if ($orphanedSections.Count -gt 0) {
		if($addedOrphanedNode -eq $false)
		{
			$addedOrphanedNode = $true
			$treeView.Nodes.Add($orphanedNode)
		}
        foreach ($section in $orphanedSections) {
            $sectionNode = New-Object System.Windows.Forms.TreeNode
            $sectionNode.Text = $section.DisplayName
            $sectionNode.Tag = $section
            $sectionNode.ImageIndex = 1
			$sectionNode.SelectedImageIndex = 1
            $orphanedNode.Nodes.Add($sectionNode)
        }
    }
    
    # First pass: Identify Buildings (top level)
    $buildings = $global:placesData | Where-Object { $_.Type -eq "Building" }
    
    # Create nodes for each building
    foreach ($building in $buildings) {
        $buildingNode = New-Object System.Windows.Forms.TreeNode
        $buildingNode.Text = $building.DisplayName
        $buildingNode.Tag = $building
        $buildingNode.ImageIndex = 0
		$buildingNode.SelectedImageIndex = 0
        $treeView.Nodes.Add($buildingNode)
        
        # Find all floors in this building
        $floors = $global:placesData | Where-Object { $_.ParentId -eq $building.PlaceId -and $_.Type -eq "Floor" }
        
        foreach ($floor in $floors) {
            $floorNode = New-Object System.Windows.Forms.TreeNode
            $floorNode.Text = $floor.DisplayName
            $floorNode.Tag = $floor
            $floorNode.ImageIndex = 1
			$floorNode.SelectedImageIndex = 1
            $buildingNode.Nodes.Add($floorNode)
            
            # Find all sections in this floor
            $sections = $global:placesData | Where-Object { $_.ParentId -eq $floor.PlaceId -and $_.Type -eq "Section" }
            
            foreach ($section in $sections) {
                $sectionNode = New-Object System.Windows.Forms.TreeNode
                $sectionNode.Text = $section.DisplayName
                $sectionNode.Tag = $section
                $sectionNode.ImageIndex = 2
				$sectionNode.SelectedImageIndex = 2
                $floorNode.Nodes.Add($sectionNode)
                
                # Find spaces in this section
                $spaces = $global:placesData | Where-Object { $_.ParentId -eq $section.PlaceId -and $_.Type -eq "Space"}
                
                foreach ($space in $spaces) {
                    $spaceNode = New-Object System.Windows.Forms.TreeNode
                    $spaceNode.Text = $space.DisplayName
                    $spaceNode.Tag = $space
                    $spaceNode.ImageIndex = 3
					$spaceNode.SelectedImageIndex = 3
                    $sectionNode.Nodes.Add($spaceNode)
                }
				
				# Find rooms in this section
                $rooms = $global:placesData | Where-Object { $_.ParentId -eq $section.PlaceId -and $_.Type -eq "Room"}
                
                foreach ($room in $rooms) {
                    $roomNode = New-Object System.Windows.Forms.TreeNode
                    $roomNode.Text = $room.DisplayName
                    $roomNode.Tag = $room
                    $roomNode.ImageIndex = 4
					$roomNode.SelectedImageIndex = 4
                    $sectionNode.Nodes.Add($roomNode)
                }
            }
            
            # Add any spaces directly under the floor
            $floorSpaces = $global:placesData | Where-Object { $_.ParentId -eq $floor.PlaceId -and $_.Type -eq "Space" }
            
            foreach ($space in $floorSpaces) {
                if ($space.Type -ne "Floor" -and $space.Type -ne "Section") {
                    $spaceNode = New-Object System.Windows.Forms.TreeNode
                    $spaceNode.Text = $space.DisplayName
                    $spaceNode.Tag = $space
                    $spaceNode.ImageIndex = 3
					$spaceNode.SelectedImageIndex = 3
                    $floorNode.Nodes.Add($spaceNode)
                }
            }
			
			 # Add any spaces directly under the floor
            $floorRooms = $global:placesData | Where-Object { $_.ParentId -eq $floor.PlaceId -and $_.Type -eq "Room" }
            
            foreach ($room in $floorRooms) {
                if ($room.Type -ne "Floor" -and $room.Type -ne "Section") {
                    $floorRooms = New-Object System.Windows.Forms.TreeNode
                    $floorRooms.Text = $room.DisplayName
                    $floorRooms.Tag = $room
                    $floorRooms.ImageIndex = 4
					$floorRooms.SelectedImageIndex = 4
                    $floorNode.Nodes.Add($floorRooms)
                }
            }
        }
        
        # Add any spaces directly under the building
        $buildingSpaces = $global:placesData | Where-Object { $_.ParentId -eq $building.PlaceId -and $_.Type -ne "Floor" }
        
        foreach ($space in $buildingSpaces) {
            if ($space.Type -ne "Floor" -and $space.Type -ne "Section") {
                $spaceNode = New-Object System.Windows.Forms.TreeNode
                $spaceNode.Text = $space.DisplayName
                $spaceNode.Tag = $space
                $spaceNode.ImageIndex = 3
				$spaceNode.SelectedImageIndex = 3
                $buildingNode.Nodes.Add($spaceNode)
            }
        }
    }
        
    # Expand the first level
    $treeView.ExpandAll()
}

# Connect button click event
$connectButton.Add_Click({
    $statusLabel.Text = "Connecting to Microsoft Places..."
    $form.Cursor = [System.Windows.Forms.Cursors]::WaitCursor
    
    try {
        # Run the Connect-MicrosoftPlaces command
        Connect-MicrosoftPlaces
        $statusLabel.Text = "Connected to Microsoft Places. Click 'Get Data' to retrieve places."
    }
    catch {
        [System.Windows.Forms.MessageBox]::Show("Error connecting to Microsoft Places: $_", "Connection Error", [System.Windows.Forms.MessageBoxButtons]::OK, [System.Windows.Forms.MessageBoxIcon]::Error)
        $statusLabel.Text = "Connection failed"
    }
    finally {
		$getDataButton.Enabled = $true
		$connectButton.Enabled = $false
        $form.Cursor = [System.Windows.Forms.Cursors]::Default
    }
})

# Get Data button click event
$getDataButton.Add_Click({
    $statusLabel.Text = "Retrieving Places data..."
    $form.Cursor = [System.Windows.Forms.Cursors]::WaitCursor
    
    try {
        # Populate the TreeView
        Populate-TreeView
    }
    catch {
        [System.Windows.Forms.MessageBox]::Show("Error retrieving Places data: $_", "Data Error", [System.Windows.Forms.MessageBoxButtons]::OK, [System.Windows.Forms.MessageBoxIcon]::Error)
        $statusLabel.Text = "Failed to retrieve data"
    }
    finally {
        $form.Cursor = [System.Windows.Forms.Cursors]::Default
		$splitContainer.SplitterDistance = 280
    }
})

function Convert-ObjectToSting()
{
	$selectedNode = $treeView.SelectedNode
	if ($selectedNode -and $selectedNode.Tag) {
	$originalObject = $selectedNode.Tag
	# Create a new object and add properties with string values
	$stringObject = New-Object -TypeName PSObject
	$originalObject.PSObject.Properties | ForEach-Object {
		# Trim any leading/trailing whitespace and convert to string
		if($_.Value -ne $null)
		{
			$stringValue = $_.Value.ToString().Trim()
			$stringObject | Add-Member -MemberType NoteProperty -Name $_.Name -Value $stringValue
		}
		else
		{
			$stringValue = ""
			$stringObject | Add-Member -MemberType NoteProperty -Name $_.Name -Value $stringValue
		}
	}
		return $stringObject
	}
	return $null
}


$treeView.Add_AfterSelect({
	$stringObject = Convert-ObjectToSting
    if ($stringObject) {
		$propertyGrid.SelectedObject = $stringObject
    }
    else {
        $propertyGrid.SelectedObject = $null
    }
})

# Handle form resize to adjust the split container splitter distance
$form.Add_Resize({
    $splitContainer.SplitterDistance = [Math]::Min(300, $form.Width * 0.3)
})


# Show the form
$form.ShowDialog()
